function LoginPage() {
    return (
        <>
            <h1>Login</h1>

            <label>
                Username: <input name={"Username"}/>
            </label>
                Password: <input name={"Password"}/>
            
            <button>Login</button>
            <button>Register</button>
        </>
    );
}

export default LoginPage
